import React, { Component } from 'react';
import './Skills.css';
import Menu from '../../components/Menu/Menu';
import  { skillList } from '../../shared/skills';
import SkillProgress from '../../components/SkillProgress/SkillProgress';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

// import { faLinkedinIn } from '@fortawesome/free-brands-svg-icons';
// import { faGithub } from '@fortawesome/free-brands-svg-icons';
import { faJava } from '@fortawesome/free-brands-svg-icons';
// import { faCoffe } from '@fortawesome/free-brands-svg-icons';
import { faCoffee } from '@fortawesome/free-solid-svg-icons';

import { Line, Circle } from 'rc-progress';



class Skills extends Component {

    render() {
        let skills =  Object.entries(skillList).map(([key, value]) => 
            <div className="ProgressBar">
                {key}
                <FontAwesomeIcon className="Icons" icon={"java"}  style={{color:'f37121'}}/>
                <Line percent={value} strokeWidth="3" strokeColor="#fe8a71" />
            </div> 
    );

        return(
            <div>
                <div className="SmallOrangeSpace"></div>
                <Menu/>
                <div className="Skills">
                    <h1>Skills</h1>
                    <div className="SkillList">
                        {skills}
                    </div>
                </div>
            </div>
        );
    }
}
export default Skills;
